import React, { useState } from 'react';
import { AppBar, Toolbar, IconButton, Badge, MenuItem, Menu, Typography, Button } from '@material-ui/core';
import { ShoppingCart } from '@material-ui/icons';
import { Link, useLocation } from 'react-router-dom';
import Jaziira from './JAZIIRA.png'
import useStyles from './style'
import './style.css'
// import './Functionality'


const Navigation = () => {
  setTimeout(()=>{
      const toggleButton = document.getElementsByClassName('toggle-button')[0]
  const navbarLinks = document.getElementsByClassName('navbar-links')[0]
  console.log(toggleButton)
  toggleButton.addEventListener('click', () => {
    navbarLinks.classList.toggle('active')
  })
  
  }, 4000)
  const [openH, setOpenH] = useState(true)
  const [mobileMoreAnchorEl, setMobileMoreAnchorEl] = useState(null);
  const classNamees = useStyles();
  const location = useLocation();
  

  const isMobileMenuOpen = Boolean(mobileMoreAnchorEl);

  const handleMobileMenuClose = () => setMobileMoreAnchorEl(null);


  return (
    <>
    <nav className="navbar">
    <div className="brand-title">
        CARWA JAZIIRA</div>
    <a href="#" className="toggle-button">
      <span className="bar"></span>
      <span className="bar"></span>
      <span className="bar"></span>
    </a>
    <div className="navbar-links">
      <ul>
        <li><a href="#">Home</a></li>
        <li><a href="#">About</a></li>
        <li><a href="#">Contact</a></li>
      </ul>
    </div>
  </nav>
  <div class="side-links">
  <a href="https://youtu.be/At4B7A4GOPg" target="_blank" class="side-link side-link-youtube">
    <i class="fab fa-youtube-square side-link-icon"></i>
    <span className="side-link-text">View Tutorial</span>
  </a>
  <a href="https://github.com/WebDevSimplified" target="_blank" className="side-link side-link-github side-link-icon">
    <i className="fab fa-github-square"></i>
    <span className="side-link-text">View GitHub</span>
  </a>
  <a href="https://twitter.com/DevSimplified" target="_blank" className="side-link side-link-twitter">
    <i className="fab fa-twitter-square side-link-icon"></i>
    <span className="side-link-text">View Twitter</span>
  </a>
</div>
    </>
  );
};

export default Navigation;
